export default props => (
    <div>
         <link rel = "icon" href ='' type = "image/x-icon"/> 
      <Head>
     
                
                    <title>Pablo Pose</title>
                </Head>
            <Navbar />
            <Intro />
    
        <Footer />
    </div>
);
